import eventsData from './eventsData'
import Event from './Event'

const Tbody = () => {
    return (
        <tbody>
            {events.map((e) => (
                <Event
                    key={e.id}
                    id={e.id}
                    title={e.name}
                    place={e.place}
                    deadline={e.deadline}
                    stt={e.status}
                    budget={e.budget}
                />
            ))}
        </tbody>
    );
};

export default Tbody;
